const skillsHTML = skills
  .map(
    (skill) => `
  <button type="button" class="skill-button" id="${skill.title.toLowerCase()}-btn">
    ${skill.svg} ${skill.title}
  </button>`
  )
  .join("");

// Set the HTML of the skills list element
if (skillsList) {
  skillsList.innerHTML = skillsHTML;
}

// Ensure the "MERN" button has no functionality
const mernButton = document.getElementById("mern-btn");
if (mernButton) {
  mernButton.addEventListener("click", function (event) {
    event.preventDefault();
  });
}